function ContactUs() {
  return (
    <>
    <div style={{ maxWidth: '600px', margin: '0 auto', padding: '20px' }}>
      <h1 style={{ textAlign: 'center' }}>Contact Us</h1>

      <form style={{ marginTop: '30px' }}>
        <label htmlFor="name">Name:</label><br />
        <input type="text" id="name" name="name" style={{ width: '100%', padding: '10px', marginBottom: '10px' }} /><br />

        <label htmlFor="email">Email:</label><br />
        <input type="email" id="email" name="email" style={{ width: '100%', padding: '10px', marginBottom: '10px' }} /><br />

        <label htmlFor="message">Message:</label><br />
        <textarea id="message" name="message" style={{ width: '100%', padding: '10px', marginBottom: '10px' }} rows="5"></textarea><br />

        <button type="submit" style={{ padding: '10px 20px', backgroundColor: '#4CAF50', color: 'white', border: 'none', cursor: 'pointer' }}>Submit</button>
      </form>

    </div>
    </>

  );
}

export default ContactUs;
